import styled from "styled-components";
import handleCpf from "../Utils/handleCPF";
import handleEmail from "../Utils/handleEmail";
import handleCep from "../Utils/handleCep";

const Input = styled.input`
    width:80vw;
    height: 1.3rem;
    background-color: #00000040;
    border:1px solid #ffffff40;
    border-radius:.2rem;
    color:#fff;
    outline:none;
    text-align: center;
`
function fullInput(props) {
    switch (props.dataType) {
        case 'cpf':
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input type="text"
                    title={props.title}
                    placeholder="_____-___"
                    onChange={handleCpf}
                    maxLength={9}
                />
            </div>);

        case 'cep':
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input type="text"
                    title={props.title}
                    placeholder="_____-__"
                    onChange={handleCep}
                    maxLength={9}
                />
            </div>);

        case 'date':
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input type="date"
                    title={props.title}
                />
            </div>);

        case 'e-mail':
            return (
                <div>
                    <span>
                        {props.title}
                    </span>
                    <br />
                    <Input
                        type="text"
                        title={props.title}
                        placeholder="Insira seu e-mail"
                        onChange={handleEmail}
                    />
                </div>
            )

        case 'name':
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input type="text" title={props.title} />
            </div>);

        case 'endereco':
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input id={props.title + 'lo'} type="text" title={props.title} />
                <Input id={props.title} type="text" title={props.title} />
                <Input id={props.title} type="text" title={props.title} />
                <Input id={props.title} type="text" title={props.title} />

            </div>); 

        default:
            return (<div>
                <span>
                    {props.title}
                </span>
                <br />
                <Input id={props.title} type="text" title={props.title} />
            </div>);
    }
}
export default fullInput;
